		db 'Experience suggests that a common cause of i.e. 1007',0Ah
		db 'is unreliable memory or other hardware.  The 1007 assertion',0Ah
		db 'just happens to cross-check the results of huge numbers of',0Ah
		db 'memory reads/writes, and so acts (unintendedly) as a stress',0Ah
		db 'test of your memory system.',0Ah
		db 0Ah
		db 'I suggest the following: try compressing the file again,',0Ah
		db 'possibly monitoring progress in detail with the -vv flag.',0Ah
		db 0Ah
		db '* If the error cannot be reproduced, and/or happens at different',0Ah
		db '  points in compression, you may have a flaky memory system.',0Ah
		db '  Try a memory-test program.  I have used Memtest86',0Ah
		db '  (www.memtest86.com).  At the time of writing it is free (GPLd).'
		db 0Ah
		db '  Memtest86 tests memory much more thorougly than your BIOSs',0Ah
		db '  power-on test, and may find failures that the BIOS doesn',27h,'t.',0Ah
		db 0Ah
		db '* If the error can be repeatably reproduced, this is a bug in',0Ah
		db '  bzip2, and I would very much like to hear about it.  Please',0Ah
		db '  let me know, and, ideally, save a copy of the file causing the',0Ah
		db '  problem -- without which I will be unable to investigate it.',0Ah
